import React,{ useContext } from 'react'
import { AppProvider } from './contexts/CoinContext';
import Coins from './components/Coins';

export default function App() {
  const {getCoins,setCoins,coin} = useContext(AppProvider);
  getCoins().then((data)=>{
    setCoins(data);
  })
  return (
    <div>
      <Coins coins = {coin} />
    </div>
  )
}
